import React from 'react'
import {SuperSubgrid2, Button, Head,Desc } from './Service.elements';
function Component(props) {

    
    return (
       
                <SuperSubgrid2>
             {props.icon}
             <Head >{props.head}</Head>
             <Desc >{props.desc}</Desc>
             <Button>Learn More</Button>

                </SuperSubgrid2>

    )
}

export default Component
